var tipuesearch = {"pages": [{'title': 'About', 'text': 'stage1-bg20 \n 組員:40823213,40823232 \n stage1組別網站: https://40823232.github.io/stage1-bg20/content/index.html \n stage1 gitter: https://gitter.im/2020bg5/stage1-bg20 \n stage2-bg2 \n 組員:40823213,40823232,40823234,40823235 \n stage2組別網站: https://40823232.github.io/stage2-bg2/content/index.html \n stage2 gitter: https://gitter.im/stage2-bg2/community \n stage3-bg1 \n 組員:40823208,40823213,40823232,40823234,40823235,40823245,40823246,40823251 \n stage3組別網站: https://40823232.github.io/stage3-bg1/content/index.html \n stage3 gitter: https://gitter.im/stage2-bg2/community \n', 'tags': '', 'url': 'About.html'}, {'title': 'stage1各週進度', 'text': '建立網站並且分配組員工作。 \n', 'tags': '', 'url': 'stage1各週進度.html'}, {'title': 'w1', 'text': '建立網站: https://40823232.github.io/cd2021/content/index.html \n 建立網站影片： \n \n stage1 gitter: \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2討論主題', 'text': '進度規劃: \n 題目:遊樂設施 動機:了解設施的構造，和作動的方式 第二週:繪製零件圖，並使用coppeliasim進行模擬 第三週:模擬問題討論及修改 第四週:報告 \n', 'tags': '', 'url': 'w2討論主題.html'}, {'title': 'w3模擬', 'text': '桿子裝上馬達後無法控制升降的角度，因此嘗試使用連桿機構 \n 模擬.ttt \n \n 因為這次主題需要用到連桿機構，故模擬pyslvs。 \n \n 第一次模擬，雖然物體有升降，但路徑不是我們需要的 \n \n 第二次模擬，路徑接近但滑塊會延伸過長，升降的範圍也較小。 \n \n 第三次模擬，前方在下降的時候，會微微向前傾斜 \n \n 第四次模擬，讓前方升降過程較為穩定 \n', 'tags': '', 'url': 'w3模擬.html'}, {'title': 'w4報告', 'text': '小組每週報告: stage1-bg20.pdf \n 小組reveal: https://40823232.github.io/stage1-bg20/reveal/index.html#/ \n 個人報告影片: \n 小組報告影片: \n \n 模擬.ttt \xa0\xa0 組合.stl \n', 'tags': '', 'url': 'w4報告.html'}, {'title': 'stage2各週進度', 'text': '我們的主題要沿用stage1，並加以改良 \n', 'tags': '', 'url': 'stage2各週進度.html'}, {'title': 'w6', 'text': '我們想利用三角函數的曲線驅動桿子沿著此路徑移動(繪圖者:40823213) \n \n 支架.ipt \n 主體.ipt \n 底座.ipt \n 容器.ipt \n 組合.iam \n 3d凸輪.ipt \n 第一次模擬(模擬者:40823234) 第一次模擬.ttt \n \n 在模擬後發現桿子沿著弧線移動時，弧線的波落差大，在移動的時候會有干涉 \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '第二次模擬(模擬者:40823234) 第二次模擬.ttt \n \n 改為平緩的弧線後，發現桿子移動一小段距離 ，桿子的長度無法在弧線上約束 \n 第三次模擬(模擬者:40823234) 第三次模擬.ttt \n \n 採用圓柱凸輪後，能夠約束桿子，不過旋轉中還是有抖動 \n 零件檔: \n 凸輪(第一版).ipt \n 主體.ipt \n 支架.ipt \n 容器.ipt \n 組合.iam \n w7 \n 支架4-9.ipt \n 主體4-9-1.ipt \n 凸輪設計4-9.ipt \n 組合(修改4-11).iam \n w8 \n 凸輪4-1 \n 組合4-17 \n 支架4-17 \n 組合4-15 \n 支架4-15 \n 支架4-15-2 \n 凸輪4-16 \n w9 \n 組合 \n 支架4-17縮小球體.ipt \n 3d凸輪4-16(第三改法).ipt \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '建立heroku(教學在note裡) \n heroku: https://s40823232.herokuapp.com/ \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w9報告', 'text': '小組報告影片 \n \n reveal: https://40823232.github.io/stage2-bg2/reveal/index.html#/ \n pdf: https://drive.google.com/file/d/19qYz3ii_0UKM6-LDgllXJ0c9eKCVnI4A/view?usp=sharing \n 最後產出類模組化設定 \n 1.像這樣的凸輪上面有特製的紋路可供支架跑 \n \n 2.支架講解 \n 支架在跑的時候會變成弧形，為了試驗他的弧形，刻意將桿子設計成可伸縮版本。 \n \n 2.但是如果要隨時改動尺寸的話太不方便了!所以設計這一種可以隨時更動的曲線。藉由改波峰多寡和上下大小來完成各種不同的設計。 \n \n 3.以下是總圖 \n \n 4.講解影片 \n \n 模擬.ttt  \xa0 組合.stl \n 參考資料 \n https://www.evget.com/article/2020/8/13/37561.html \n https://www.youtube.com/watch?v=s5O9_Ny9ufA \n', 'tags': '', 'url': 'w9報告.html'}, {'title': 'stage3各週進度', 'text': '以task工作為主，並利用line群組通話討論接下來要做的主題 \n', 'tags': '', 'url': 'stage3各週進度.html'}, {'title': 'w10', 'text': 'gitter: https://gitter.im/stage3-bg1/community \n 小組討論主題，想把目前各組所做的題目合成一起，讓中間有關聯。 \n \n', 'tags': '', 'url': 'w10.html'}, {'title': 'ipv4連線', 'text': '先到網路連線的ipv4更改成192.168.192.各自號碼 \n \n 確定後，到黑窗輸入 \n python -m http.server 8000 --bind 192.168.192.各自號碼 \n 接著至網址輸入192.168.192.各自號碼：8000，成功後網頁會變這樣 \n \n \n', 'tags': '', 'url': 'ipv4連線.html'}, {'title': 'ｗ11', 'text': '測試obs直播串流 \n \n \n', 'tags': '', 'url': 'ｗ11.html'}, {'title': 'task1', 'text': '參考:40823245 \n stage3-2b.txt 文字檔 \n 下面程式碼另存一個py檔 \n def stu2b(account):\n    if account == "40823231":\n        return account + "-2"\n    elif account[0:3] == "407":\n        return "s" + account\n    else:\n        return account\n \nteamb = []\n \n# open file, default is read mode, since txt content no chinese char\n# no encoding = "UTF-8" is needed\nwith open("stage3_2b.txt") as fh:\n    # readlines will read into the whole line and put into list format\n    # has \\n at the end of each line\n    data = fh.readlines()\n#print(len(data))\nfor i in range(len(data)):\n    group = data[i].rstrip("\\n").split("\\t")\n    teamb.append(group)\n     \noutput = ""    \nseperator = "-"*10 + "<br />"\n \nfor i in teamb[0:]:\n    team = i[0]\n    leader = stu2b(i[1])\n    m1 = stu2b(i[3])\n    m2 = stu2b(i[5])\n    m3 = stu2b(i[7])\n    m4 = stu2b(i[9])\n    m5 = stu2b(i[11])\n    m6 = stu2b(i[13])\n     \n    try:\n        m7 = stu2b(i[15])\n    except:\n        m7 = ""\n    try:\n        m8 = stu2b(i[17])\n    except:\n        m8 = ""\n         \n    leaderrepo = "<a href=\'http://github.com/" + leader + "/cd2021\'>" + leader + " repo</a>"\n    leadersite = "<a href=\'http://" + leader + ".github.io/cd2021\'>" + leader +  " site</a>"\n    m1repo = "<a href=\'http://github.com/" + m1 + "/cd2021\'>" + m1 + " repo</a>"\n    m1site = "<a href=\'http://" + m1 + ".github.io/cd2021\'>" + m1 +  " site</a>"\n    m2repo = "<a href=\'http://github.com/" + m2 + "/cd2021\'>" + m2 + " repo</a>"\n    m2site = "<a href=\'http://" + m2 + ".github.io/cd2021\'>" + m2 +  " site</a>"\n    m3repo = "<a href=\'http://github.com/" + m3 + "/cd2021\'>" + m3 + " repo</a>"\n    m3site = "<a href=\'http://" + m3 + ".github.io/cd2021\'>" + m3 +  " site</a>"\n    m4repo = "<a href=\'http://github.com/" + m4 + "/cd2021\'>" + m4 + " repo</a>"\n    m4site = "<a href=\'http://" + m4 + ".github.io/cd2021\'>" + m4 +  " site</a>"\n    m5repo = "<a href=\'http://github.com/" + m5 + "/cd2021\'>" + m5 + " repo</a>"\n    m5site = "<a href=\'http://" + m5 + ".github.io/cd2021\'>" + m5 +  " site</a>"\n    m6repo = "<a href=\'http://github.com/" + m6 + "/cd2021\'>" + m6 + " repo</a>"\n    m6site = "<a href=\'http://" + m6 + ".github.io/cd2021\'>" + m6 +  " site</a>"\n  \n \n    teamrepo = "<a href=\'http://github.com/" + leader + "/" + team + "\'>" + team + " repo</a>"\n    teamsite =  "<a href=\'http://" + m1 + ".github.io/" + team + "\'>" + team +  " site</a>"\n \n    output += teamrepo + " | " + teamsite + " | " +leaderrepo + " | " + leadersite + " | " +m1repo + " | " + m1site + " | " +m2repo + " | " + m2site + " | " +m3repo + " | " + m3site + " | " +m4repo + " | " + m4site + " | " +m5repo + " | " + m5site + " | " +m6repo + " | " + m6site \n     \n    if m7 != "":\n       m7repo = "<a href=\'http://github.com/" + m7 + "/cd2021\'>" + m7 + " repo</a>"\n       m7site = "<a href=\'http://" + m7 + ".github.io/cd2021\'>" + m7 +  " site</a>"   \n       output += " |  " + m7repo + "| " + m7site\n    else:\n        output += "" \n     \n    if m8 != "":\n       m8repo = "<a href=\'http://github.com/" + m8 + "/cd2021\'>" + m8 + " repo</a>"\n       m8site = "<a href=\'http://" + m8 + ".github.io/cd2021\'>" + m8 +  " site</a>"   \n       output += " |  " + m8repo + "| " + m8site + "<br />" + seperator\n    else:\n        output += "<br />" + seperator\n \n \nprint(output)\n# the following will use group data to generate needed html \n 在白窗執行，將結果貼上 \n \n stage3-bg1 repo  |  stage3-bg1 site  |  40823245 repo  |  40823245 site  |  40823251 repo  |  40823251 site  |  40823208 repo  |  40823208 site  |  40823213 repo  |  40823213 site  |  40823232 repo  |  40823232 site  |  40823234 repo  |  40823234 site  |  40823235 repo  |  40823235 site  |  40823246 repo |  40823246 site ---------- stage3-bg2 repo  |  stage3-bg2 site  |  40823217 repo  |  40823217 site  |  40823201 repo  |  40823201 site  |  40823209 repo  |  40823209 site  |  40823210 repo  |  40823210 site  |  40823206 repo  |  40823206 site  |  40823207 repo  |  40823207 site  |  40823223 repo  |  40823223 site  |  40823224 repo |  40823224 site ---------- stage3-bg3 repo  |  stage3-bg3 site  |  40823236 repo  |  40823236 site  |  40823202 repo  |  40823202 site  |  40823203 repo  |  40823203 site  |  40823212 repo  |  40823212 site  |  40823219 repo  |  40823219 site  |  40823222 repo  |  40823222 site  |  40823231-2 repo  |  40823231-2 site  |  40823244 repo |  40823244 site ---------- stage3-bg4 repo  |  stage3-bg4 site  |  40823239 repo  |  40823239 site  |  s40723140 repo  |  s40723140 site  |  s40723128 repo  |  s40723128 site  |  s40723139 repo  |  s40723139 site  |  s40723106 repo  |  s40723106 site  |  s40723135 repo  |  s40723135 site  |  s40723143 repo  |  s40723143 site  |  s40723215 repo |  s40723215 site ---------- stage3-bg5 repo  |  stage3-bg5 site  |  40823221 repo  |  40823221 site  |  40823204 repo  |  40823204 site  |  40823205 repo  |  40823205 site  |  40823220 repo  |  40823220 site  |  40823228 repo  |  40823228 site  |  40823237 repo  |  40823237 site  |  40823242 repo  |  40823242 site  |  40823250 repo |  40823250 site  |  40832244 repo |  40832244 site ---------- stage3-bg6 repo  |  stage3-bg6 site  |  40823225 repo  |  40823225 site  |  40823214 repo  |  40823214 site  |  40823218 repo  |  40823218 site  |  40823211 repo  |  40823211 site  |  40823248 repo  |  40823248 site  |  40823247 repo  |  40823247 site  |  40823216 repo  |  40823216 site  |  40823238 repo |  40823238 site ---------- stage3-bg7 repo  |  stage3-bg7 site  |  40623144 repo  |  40623144 site  |  40823233 repo  |  40823233 site  |  s40723224 repo  |  s40723224 site  |  40823241 repo  |  40823241 site  |  40423155 repo  |  40423155 site  |  40823227 repo  |  40823227 site  |  s40723233 repo  |  s40723233 site ---------- \n', 'tags': '', 'url': 'task1.html'}, {'title': 'w12', 'text': 'task2\xa0 測試日期:2021/5/14 \n \n import sim as vrep\nimport math\nimport random\nimport time\n \nprint (\'Start\')\n \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.192.115\', 19997, True, True, 5000, 5)\n \nif clientID != -1:\n    print (\'Connected to remote API server\')\n \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823232",\n        vrep.simx_opmode_oneshot)\n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n    # Communication operating mode with the remote API : wait for its answer before continuing (blocking mode)\n    # http://www.coppeliarobotics.com/helpFiles/en/remoteApiConstants.htm\n    opmode = vrep.simx_opmode_oneshot_wait\n \n    # Try to retrieve motors and robot handlers\n    # http://www.coppeliarobotics.com/helpFiles/en/remoteApiFunctionsPython.htm#simxGetObjectHandle\n    vrep.simxStartSimulation(clientID,opmode)\n    ret1,front_handle = vrep.simxGetObjectHandle(clientID, "Revolute_joint", opmode)\n    \n\nelse:\n    print (\'Failed connecting to remote API server\') \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13建立gitlab', 'text': '因為個人github遭到封鎖，故建立gitlab \n 在網頁搜尋gitlab sign up建立自己的帳號，並建立倉儲 \n \n 倉儲要設為public且Initialize repository with a README不要打勾。 \n 到黑窗的倉儲輸入git branch查看分支狀態，再到倉儲跟目錄找出.gitlab-ci.yml用白窗打開將master改成main \n \n save完後acp再輸入 \n git remote add gitlab https://gitlab.com/40823232/倉儲名.git\n \n 然後git push gitlab。到gitlab確定有推上去(commit會打勾)，再到setting的page重整會有出現網址 \n \n 該網址為網站連結。 \n ssh做法與之前相同，但putty要新增一個gitlab.com到auth選擇鑰匙 \n \n \n', 'tags': '', 'url': 'w13建立gitlab.html'}, {'title': '小組直播影片', 'text': '課堂時段利用google meet進行小組討論 \n 2021/05/21 \n \n 2021/06/04 \n \n 2021/06/11 \n \n', 'tags': '', 'url': '小組直播影片.html'}, {'title': 'W14', 'text': 'RoboDK測試: \n \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '影片字幕整理 \n 第一部: \n \n 中文字幕: \n 該機構的提示框由兩個數字簡單描述，相對於絕對坐標系的坐標 x 和 y。 \n 所以，這裡的問題是有了x和y條件，我們要求解連接角q1和q2的值為多少。 \n 我們利用特定幾何來解決這個問題。 \n 我們從一個簡單的結構開始。 \n 我們將在機構上覆蓋紅色三角形。 \n 我們知道最終坐標是x，y，所以三角形的垂直高度為y，水平寬度為x。 \n 然後，利用Pythagorean theorem(畢氏定理)，我們可寫出 r² = x ²+ y²。 \n 到目前為止都很容易。 \n 現在，我們查看此處凸顯的紅色三角形，並且要確定α角。 \n 為了做到這一點，我們須使用餘弦定理。 \n 如果你對餘弦定理有點生疏，這裡可以幫助你複習一下。 \n 有一個任意三角形。 \n 三角形中沒有任何的直角，將這邊的角度標為小a，而對邊的長度標為A。 \n 我們再對這邊和這個角，以及這邊和這個叫做同樣的事。 \n 以此類推，所有邊都標記為A, B, C，角都標記為a, b, c 。 \n 餘弦定理就是這種關係。 \n 它有點像畢達哥拉斯定理，不同之處是末端多出了cos a。 \n 將餘弦定理套用於剛剛看到的特定三角形。 \n 寫下此特殊關係很簡單。 \n 我們可分離出 cosα ，只需要得知α角度作為條件。它是根據恆定連桿長度A1和A2以及最終執行器的位置x和y定義。 \n 我們可寫出角度α和q2之間的簡單關係。並且我們從餘弦函數中得知cos q2必須等於 –cos α。 \n 這次寫出餘弦在連接角q2的表達式。 \n 我們繪製另一個紅色三角形，並應用三角函數。 \n 如果我們知道q2，就可知道這個長度和這個三角形的長度。我們可以在連接角q2寫出正弦關係。 \n 現在我們考慮這個大一點的三角形，它角度是β，此三角形的邊長由藍色表示。且三角形另一邊長度是這個。 \n 我們可在此根據參數寫出角度β的表達式。回到之前畫的紅色三角形，我們可建立出q1和β的關係。 \n 引入另一個角度ɣ，可寫出角度ɣ和提示框座標x和y之間的關係。現在我們可建構出角度β和ɣ與連接角度q1之間的關係。而且，整個關係看起來像這樣。 \n 相當複雜的關係，它提供連接的角度，即最終執行器坐標 y 和 x 的 q1，以及一系列常數 a1 和 a2，它也是第二個關節角度 q2 的函數。 \n 所以，總結我們在這裡得出了什麼。我們有q2餘弦方程式與q1方程式。餘弦函數在0對稱。 \n 所以我們知道cosq2的值可能為正角和負角。我們選擇正角，表示我可以寫出此表達式。 \n 現在我們能用逆向運動學來解決雙連桿機構。我們有兩個連接角 q1 和 q2 的表達式，根據最終執行器的x 和 y 以及一系列常數。 \n 你要注意到兩方程式不是獨立的。事實上，q1方程式取決於q2的解。在這情況下，q2為負，我們將在q2反餘弦的解前面加上負號。 \n 我們需求解q1，因此采用這個特定的三角形，之前求解的角度β以及根據y和x定義的角度ɣ。 \n q1、ɣ和β之間的關西，和之前求的不同。涉及到符號的變化。 \n 然後我們可代換之前所有等式，並求得此q1方程式。同樣，這裡的符號發生了變化。先前，這是個負號。 \n 這是雙連桿機構在此逆向運動學的總形式，其中q2為負。 \n 讓我們比較兩個解決方案，q2為正和q2為負的情況。 \n 第二部: \n 開啟字幕 \n \n 中文字幕: \n 在這裡，我們有與前一篇相同的兩連桿機械手臂，但這次我們將使用分析方法來解決它，意味著我們將更多地依賴代數，特別是使用線性代數而不是幾何。 我們有一個表達式 E，它是表示機械手臂最終位置的齊次變換式，我們在上一課中看到了這一點，我們可以將最終位置寫為一系列基本齊次變換式。 Q1 旋轉，A1 沿 X 方向平移，Q2 旋轉，然後 A2 沿 X 方向平移。 如果我將其展開，將所有變換相乘，就會得到此處所示的表達式 E ;它是一個三乘三的齊次變換矩陣，表示機械手臂的最終的位置。 現在對於這個特殊的兩連桿機器人，我們只對它的最終位置感興趣，與它有關的是 X 和 Y 坐標，它們是齊次變換矩陣中的這兩個元素，所以我將把它們複製出來。 所以這裡又是我們對 X 和 Y 的表達式，我們要做的是一個相當常見的技巧，我們要將它平方並將這兩個方程相加，我得到一個看起來像這樣的關係式。 現在我可以根據最終位置X和Y以及機械手臂的常數A1及A2來求出關節角度Q2。 現在我要做的是應用角度之和的特性。 我將展開這些項，Q1 的正弦加 Q2 或 Q1 的餘弦加 Q2，為了讓生活更輕鬆一點，我將建立一些分部，所以只要有 cos Q2，我會將其取代為C2並且在有正弦Q2的地方，我會將其取代為S2。 當人們解決機械手臂運動學方程式時，這是一個相當常見的快速記法。 這是進行替換後的方程式。 看看這兩個方程式，我可以看到它們屬於一個眾所周知的形式，對於這種形式，有一個淺顯易見的解決方案。 所以我將只考慮其中一個方程，Y 的方程，並使用我們眾所周知的恆等式和它的解，我可以確定變量小 a、小 b 和小 c 的值，一旦我確定了這些，然後我可以寫下 Q1 的解決方程，在這種特殊情況下，x 相當於 theta。 \n 這裡再次是我們對 Q1 的表達，從上一張幻燈片複製過來，我們可能還記得在我們早期的說明中，確定了這種特殊關係； X 平方加 Y 平方等於這個特定的複雜表達式。 因此，我可以將其替換並進行一些簡化，最終得到 Q1 的這個稍微不那麼複雜的表達式。 這與我在上一節中遵循幾何方法求出的表達式一模一樣。 \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16 exam', 'text': 'google drive連結: https://drive.google.com/drive/folders/1yGLWRymmOfIucmTXto5U4iZMExDvs5NC?usp=sharing \n 1.Onshape 零組件繪製 \n 圖檔連結 https://cad.onshape.com/documents/ba69fd6cd01409e870faec2f/w/2f154f1a806882e4b16bc221/e/2648d28f71480c3b30ffdeff \n 2.建立 CoppeliaSim 4.1.0 MTB robot 場景 \n \n 3.手臂末端加入 components-gripper-suction pad 吸盤 \n \n 方向鍵控制手臂，3:吸取 4:吸盤向上 5:放下 \n 4.逆向運動學函式 \n \n 5.Python remote API 逆向運動學函式 \n \n', 'tags': '', 'url': 'W16 exam.html'}, {'title': 'note', 'text': '課堂問題整理 \n', 'tags': '', 'url': 'note.html'}, {'title': 'zoomit', 'text': 'CTRL+1 縮放螢幕(能夠調整縮放倍率) \n Zoom 模式的時候，按下 滑鼠左鍵 可以啟動「 Draw 模式」 \n 退出 Zoom 模式，可以按 滑鼠右鍵 ，或者是 ESC \n \n CTRL+2 進入 DRAW 模式(非縮放模式) \n CTRL+Z (退回上一步) \n 隨意形狀 \xa0 - 直接壓住 滑鼠左鍵 然後滑鼠移動想要的線條。 \n 直線 \xa0- 壓住 SHIFT 然後 滑鼠左鍵 然後話要的線條。 \n 方塊 \xa0- 壓住 CTRL 然後 滑鼠左鍵 畫出方塊。 \n 圓圈 \xa0- 壓住 TAB 然後 滑鼠左鍵 畫出圓圈。 \n 箭頭 \xa0 - 壓住 CTRL+SHIFT 然後 滑鼠左鍵 畫出有箭頭的線。 \n 按住 T 能夠打字(英文) \n \n', 'tags': '', 'url': 'zoomit.html'}, {'title': 'pelican.leo', 'text': 'ctrl+i新增一頁 \n ctrl+u往上移動 \n ctrl+d往下移動 \n ctrl+r往右移動 \n ctrl+l往左移動 \n 點兩下變更名稱 \n \n 編輯完成後，先save之後在local-blog按右鍵，再按goto script \n \n 在黑窗執行這段文字後，就能到8444查看 \n \n github-blog是直接推送到遠端(要在cd2021的倉儲提交) \n \n 執行完畢後，add,commit,push \n', 'tags': '', 'url': 'pelican.leo.html'}, {'title': 'coppeliasim', 'text': '\n 如果要讓零件產生碰撞要開啟respondable，上排表示同個基準的零件碰撞，下排是任何基準的零件碰撞 \n 要讓零件動就要開啟dynamic \n \n 如果要將物件隱藏要把camera visibility layers給取消 \n \n 這是將組合圖拆解，方便對各零件操作 \n \n \n 要將兩物體綁在一起時，要按apply to selection(旋轉和移動) \n', 'tags': '', 'url': 'coppeliasim.html'}, {'title': 'heroku', 'text': '先到 heroku 建立帳號， 以s+學號建立一個app(https://s學號.herokuapp.com)，之後 \n 下載 heroku ，放在data裡，並在start_ipv4.bat裡新增路徑 \n set path_heroku=%Local%\\heroku\\bin;\n \n%path_heroku%; \n 關掉重開後，輸入 \n heroku version \n 再進到自己組別的資料夾，輸入 \n git remote add heroku https://git.heroku.com/s40823232.git \n 輸入完後可以在.git的config看到 \n \n 如果資料夾不是最新的檔案要先git pull，之後打heroku login -i，輸入heroku帳號的email和密碼，再打 git push heroku(以後push前資料夾不是最新的檔案都要先git pull) \n', 'tags': '', 'url': 'heroku.html'}, {'title': 'ssh', 'text': '在sh.exe創好金鑰，打ssh-keygen -t rsa -b 4096 -C "學號"，輸入要放的位置，按enter，在start_ipv4.bat新增 \n set GIT_HOME=%Disk%:\\Portablegit\\bin\\\nset GIT_SSH=%Disk%:\\putty\\plink.exe \n 在.git的config新增url = git@github.com:40823232/cd2021.git，打開 puttygen.exe的 load，找到id_rsa，s ave private key \n \n 開putty.exe，選 github.com，有proxy要設定，在auth找剛才的ppk，回到session按save \n \n 之後到github的setting裡的ssh，把 id_rsa.pub的內容貼到Key \n', 'tags': '', 'url': 'ssh.html'}, {'title': 'W5', 'text': '乙班影片表格 \n', 'tags': '', 'url': 'W5.html'}]};